  return (
    <div className="row-wrapper">
      <div className="left col-12 col-lg-6">
        { Left }
      </div>
      <div className={`right col-12 col-lg-${rightWidth}`}>
        { Right }
      </div>
    </div>
  )
};

export default Row;
